// src/pages/DepartmentLogistic.jsx
import { logisticAgents } from "../data/agents";
import AgentCard from "../components/AgentCard";
import { useState } from "react";

export default function DepartmentCommercial() {
  const [search, setSearch] = useState("");

  const filteredAgents = logisticAgents.filter((agent) =>
    `${agent.name} ${agent.role}`.toLowerCase().includes(search.toLowerCase())
  );

  return (
    <div className="min-h-screen bg-gray-50 px-6 py-10">
      <h1 className="text-3xl font-bold text-center text-indigo-700 mb-6">
        Logistic Department
      </h1>
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6 max-w-5xl mx-auto">
        {logisticAgents.map((agent) => (
          <AgentCard key={agent.id} agent={agent} />
        ))}
      </div>
    </div>
  );
}
